import React from 'react'
import { songs } from 'data/example'

const WhyChooseUsColumn = (props, wcuTitle, wcuDescription, wcuIcon, wcuReadMore) => {
    return (
        <>
            <div className="why-choose-use-col">
                {props.wcuTitle}
            </div>
        </>
    )
}

export default WhyChooseUsColumn
